        return data.get("funding_agency_code", "DEFAULT")

class UIDesigner:
    @staticmethod
    def redesign_resources_page() -> bool:
        # Simulate redesign
        logging.info("Redesigning Resources page to match Broker design styles")
        return True

    @staticmethod
